sap.ui.define(["../BaseController"],function(e){"use strict";return e.extend("asc.admin.controller.reporting.Reporting",{onInit:function(){},onSelectReportChange:function(e){this.api.getReportData(this.getView().byId("sReportName").getSelectedKey()).done(this.onGetReportDataDone.bind(this))},onGetReportDataDone:function(e){var t=this.getView().byId("idReportTable");t.removeAllColumns();var o=new sap.ui.model.json.JSONModel;o.setData({rows:e.rows,columns:e.columns});t.setModel(o);t.bindColumns("/columns",function(e,t){var o=t.getObject().columnName;return new sap.ui.table.Column({label:o,template:o,sortProperty:o,filterProperty:o})});t.bindRows("/rows")},onDataExport:function(e){var t=this.getView().byId("idReportTable");var o=t.exportData();o.saveFile(this.getView().byId("sReportName").getSelectedKey()+moment().format("_MM_DD_YYYY"))}})},true);